import React, { Component } from 'react';

class Login extends Component {
  render() {
    return (
      <div>
        <div>Login</div>
        <input placeholder="Enter email" type="text" />
        <input placeholder="Enter password" type="password" />
        <button>Login</button>
      </div>
    );
  }
}

export default Login;
